    private static IBlockState getCasingState() {
        return GTLiteMetaBlocks.SCIENCE_CASING.getState(BlockScienceCasing.ScienceCasingType.ULTIMATE_HIGH_ENERGY_CASING);
    }

    private static IBlockState getSecondCasingState() {
        return GTLiteMetaBlocks.SCIENCE_CASING.getState(BlockScienceCasing.ScienceCasingType.DIMENSIONAL_BRIDGE_CASING);
    }

    private static IBlockState getThirdCasingState() {
        return GTLiteMetaBlocks.SCIENCE_CASING.getState(BlockScienceCasing.ScienceCasingType.SPACETIME_CASING);
    }

    private static IBlockState getFourthCasingState() {
        return MetaBlocks.COMPUTER_CASING.getState(BlockComputerCasing.CasingType.HIGH_POWER_CASING);
    }

    @SideOnly(Side.CLIENT)
    @Override
    public ICubeRenderer getBaseTexture(IMultiblockPart iMultiblockPart) {
        return iMultiblockPart == null ? GTLiteTextures.ULTIMATE_HIGH_ENERGY_CASING : Textures.HIGH_POWER_CASING;
    }

    @SideOnly(Side.CLIENT)
    @Nonnull
    @Override
    protected ICubeRenderer getFrontOverlay() {
        return GTLiteTextures.DIMENSIONALLY_TRANSCENDENT_NEUTRONIUM_FORGE_OVERLAY;
    }

    @Override
    public boolean canBeDistinct() {
        return true;
    }

    @Override
    public void addInformation(@Nonnull ItemStack stack,
                               @Nullable World player,
                               @Nonnull List<String> tooltip,
                               boolean advanced) {
        super.addInformation(stack, player, tooltip, advanced);
        tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip.1"));
        tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip.2"));
        tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip.3"));
        tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip.4"));
        tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip.5"));
        tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip.6"));
        tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip.7"));
        tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip.8"));
        tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip.9"));

        if (Keyboard.isKeyDown(Keyboard.KEY_LSHIFT)) {
            tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip_shift.1"));
            tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip_shift.2"));
            tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip_shift.3"));
            tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip_shift.4"));
            tooltip.add(I18n.format("gtlitecore.machine.dimensionally_transcendent_neutronium_forge.tooltip_shift.5"));
        } else {
            tooltip.add(I18n.format("gregtech.tooltip.hold_shift"));
        }
    }

    private class DTNFRecipeLogic extends MultiblockRecipeLogic {

        public DTNFRecipeLogic(RecipeMapMultiblockController tileEntity) {
            super(tileEntity, true);
        }

        @Override
        public void setMaxProgress(int maxProgress) {
            if (casingTier == 1) {
                this.maxProgressTime = (int) (0.9 * maxProgress);
            } else if (casingTier == 2) {
                this.maxProgressTime = (int) (0.8 * maxProgress);
            } else if (casingTier == 3) {
                this.maxProgressTime = (int) (0.6 * maxProgress);
            } else if (casingTier == 4) {
                this.maxProgressTime = (int) (0.4 * maxProgress);
            } else if (casingTier == 5) {
                this.maxProgressTime = (int) (0.2 * maxProgress);
            } else {
                this.maxProgressTime = maxProgress;
            }
        }
    }

